import React from 'react';
import { Button, Grid, Toolbar, Divider } from '@material-ui/core';
import {withStyles,} from '@material-ui/core/styles';
import './Header.css';

const ColorButton = withStyles((theme) => ({
  root: {
    color: "white",
    backgroundColor: "black",
    '&:hover': {
      backgroundColor: "black",
    },
  },
}))(Button);

export default function Header() {
    return (
      <div>
        <Grid container xs={12} sm={6} alignItems="center" justify="flex-start">
            <Grid xs={6} sm={6}><img src="/images/MathLaw.PNG"></img></Grid>
            <Grid xs={6} sm={6}><img src="/images/logo.PNG" style={{marginBottom: "33px", marginLeft: "30px"}}></img></Grid>
        </Grid>
        <Grid container xs={12} sm={6} alignItems="center" justify="flex-end">
          <Grid><ColorButton>Sign Up</ColorButton></Grid>
          <Grid><ColorButton>Log In</ColorButton></Grid>
        </Grid>
      </div>

    );
}
